import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import Cookies from 'js-cookie';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [imgFile, setImgFile] = useState(null); // Store the image file
  const [showPopup, setShowPopup] = useState(false);
  const [popupMessage, setPopupMessage] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const formData = new FormData();
      formData.append('file', imgFile); // Append image file to FormData
      formData.append('user', JSON.stringify({
        idU: '',
        firstName,
        lastName,
        email,
        password,
        imgPath: '' // Leave it empty as it will be filled by the backend
      }));

      const response = await axios.post('http://localhost:8080/Auth/save', formData, {
        headers: {
          'Content-Type': 'multipart/form-data' // Set the content type to multipart/form-data
        }
      });

      if (response.data === "Image already exist" || response.data === "Email Already Exist" || response.data === "Error") {
        setShowPopup(true);
        setPopupMessage(response.data);
      } else {
        Cookies.set("UserId", response.data);
        Cookies.set("UserFN", firstName);
        Cookies.set("UserLN", lastName);
        Cookies.set("UserEm", email);
        // Cookies.set("UserIM", imgPath); // No need to set this, as it's handled by the backend
        navigate('/');
      }
    } catch (error) {
      console.error('User:', error.message, 'test');
      setShowPopup(true);
      setPopupMessage('Connection Error');
    }
  };

  const handleFileChange = (e) => {
    setImgFile(e.target.files[0]); // Store the selected image file
  };

  return (
    <section className="text-center text-lg-start">
      <div className="card mb-3">
        <div className="row g-0 align-items-center">
          <div className="col-lg-4 d-none d-lg-flex">
            <img
              src="https://mdbootstrap.com/img/new/ecommerce/vertical/004.jpg"
              alt="Trendy Pants and Shoes"
              className="w-100 rounded"
            />
          </div>
          <div className="col-lg-8">
            <div className="card-body py-5 px-md-5">
              <h1 className="mb-4 text-center title mb-3">Register</h1>
              <form onSubmit={handleSubmit}>
                <div className="row mb-4">
                  <div className="col-md-6">
                    <div className="form-group">
                      <label htmlFor="firstName">First Name<span className="text-danger">*</span></label>
                      <input
                        type="text"
                        id="firstName"
                        className="form-control"
                        required
                        value={firstName}
                        onChange={(e) => setFirstName(e.target.value)}
                      />
                    </div>
                  </div>
                  <div className="col-md-6">
                    <div className="form-group">
                      <label htmlFor="lastName">Last Name<span className="text-danger">*</span></label>
                      <input
                        type="text"
                        id="lastName"
                        className="form-control"
                        required
                        value={lastName}
                        onChange={(e) => setLastName(e.target.value)}
                      />
                    </div>
                  </div>
                </div>
                <div className="form-group mb-4">
                <label htmlFor="imgPath">Image Path</label>
            <input
              type="file" // Change input type to file
              id="imgPath"
              className="form-control"
              onChange={handleFileChange} // Handle file change event
            />
                  <label htmlFor="email">Email address</label>
                  <input
                    type="email"
                    id="email"
                    className="form-control"
                    required
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                  />
                </div>
                <div className="form-group mb-4">
                  <label htmlFor="password">Password</label>
                  <input
                    type="password"
                    id="password"
                    className="form-control"
                    required
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </div>
                <div className="form-group mb-4">
                  <label htmlFor="imgPath">Image Path</label>
                  <input
                    type="text"
                    id="imgPath"
                    className="form-control"
                    value={imgPath}
                    onChange={(e) => setImgPath(e.target.value)}
                  />
                </div>
                <div className="row mb-4">
                  <div className="col-md-6">
                    <div className="form-group">
                    <button
                        type="submit"
                        className="btn btn-primary btn-block mb-4">
                        Register
                    </button>
                    </div>
                  </div>
                  <div className="col-md-6">
                    <div className="form-group">
                    You Already have an account 
                        <a href='/Auth/Login' className=''> Login?</a>
                    </div>
                  </div>
                </div>
                {showPopup && (
                  <div className="alert alert-danger" role="alert">
                    {popupMessage}
                  </div>
                )}
              </form>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};
export default Register;
